import React, { Component } from "react";
import { connect } from "react-fela";
import { style } from "./style";

class PropertySelect extends Component {
  constructor(props) {
    super(props);
    this.select = React.createRef();
  }
  handleClick() {
    // debugger;
  }
  render() {
    const { styles } = this.props;

    /* return (
      <div className={ styles.wrapper }>
        <select className={ styles.box }>
          <option>+</option>
          <option>Remove</option>
          <option>Create</option>
          <option>Edit</option>
        </select>
        <div className={ styles.label }>{this.props.label}</div>
      </div>
    );*/

    return (
      <div className={ styles.wrapper }>
        <div className={ styles.box } onClick={ this.handleClick.bind(this) }>
          <div className={ styles.label }>{this.props.label}</div>
          <select className={ styles.select } ref={this.select}>
            <option>Remove</option>
            <option>Create</option>
            <option>Edit</option>
          </select>
        </div>
      </div>
    );
  }
}

export default connect(style)(PropertySelect);
